import React, { useState, useEffect } from 'react';

const Bush = ({ setScore, score, setTime, setGameOver, setPenalty }) => {
  const bushSize = 80;
  const circleSize = 50;
  const bottomCircleY = 40;
  const topCircleY = 25;
  const bottomCircleSpacing = 20;
  const topCircleSpacing = 25;

  const [bushes, setBushes] = useState([]);
  const [moleIndex, setMoleIndex] = useState(null);
  const [nextMoleIndex, setNextMoleIndex] = useState(null);
  const [moleVisible, setMoleVisible] = useState(false);
  const [molePosition, setMolePosition] = useState({ x: 0, y: 0 });

  const generateRandomPosition = () => {
    const x = Math.random() * (screen.availWidth - 120);
    const y = (screen.availHeight / 2) + (Math.random() * ((screen.availHeight / 2) - 120));
    return { x, y };
  };

  const generateNonOverlappingPosition = (newBushes) => {
    let newPosition;
    let isOverlapping;

    do {
      isOverlapping = false;
      newPosition = generateRandomPosition();

      for (const bush of newBushes) {
        if (
          newPosition.x < bush.x + bushSize &&
          newPosition.x + bushSize > bush.x &&
          newPosition.y < bush.y + bushSize &&
          newPosition.y + bushSize > bush.y
        ) {
          isOverlapping = true;
          break;
        }
      }
    } while (isOverlapping);

    return newPosition;
  };

  useEffect(() => {
    const initialBushes = [];
    while (initialBushes.length < 17) {
      const newPosition = generateNonOverlappingPosition(initialBushes);
      initialBushes.push(newPosition);
    }

    setBushes(initialBushes);
  }, []);

  useEffect(() => {
    const moleInterval = setInterval(() => {
      setMoleVisible(true);

      setTimeout(() => {
        setMoleVisible(false);
      }, 1250 - score * 25);
    }, 2000 - score * 35);

    return () => {
      clearInterval(moleInterval);
    };
  }, [score]);

  useEffect(() => {
    setNextMoleIndex(Math.floor(Math.random() * bushes.length));
    if (!moleVisible && nextMoleIndex !== null) {
      setMoleIndex(nextMoleIndex);
      setMolePosition({ ...bushes[nextMoleIndex] });
    }
  }, [moleVisible, nextMoleIndex, bushes]);

  const handleMoleClick = (index) => {
    createNewBushes(index);
    if (moleVisible && index === moleIndex) {
      setScore((prevScore) => prevScore + 1);
      setMoleVisible(false);
    }else if(index != moleIndex){
        setPenalty(prevPenalty => prevPenalty + 1);
    }
  };

  const handleBushClick = (index) => {
    createNewBushes(index);
    setPenalty(prevPenalty => prevPenalty + 1);
  };

  const createNewBushes = (indexToRemove) => {
    const newBushes = bushes.filter((_, index) => index !== indexToRemove);

    if (Math.random() < 0.75) {
      // 75% chance to execute this block of code
      const newPosition = generateNonOverlappingPosition(newBushes);
      newBushes.push(newPosition);
    }

    if (newBushes.length <= 0) {
      // Change the state of gameOver in Bush.js
      setGameOver(true);
    }

    setBushes(newBushes);
  };


  const renderCircles = () => {
    return (
      <div className="circle-cluster">
        <div
          className="circle"
          style={{
            width: `${circleSize}px`,
            height: `${circleSize}px`,
            borderRadius: '50%',
            backgroundColor: 'darkgreen',
            position: 'absolute',
            left: '0',
            top: `${bottomCircleY}px`,
          }}
        ></div>
        <div
          className="circle"
          style={{
            width: `${circleSize}px`,
            height: `${circleSize}px`,
            borderRadius: '50%',
            backgroundColor: 'darkgreen', // Adjust the color as needed
            position: 'absolute',
            left: `${bottomCircleSpacing}px`,
            top: `${bottomCircleY}px`,
          }}
        ></div>
        <div
          className="circle"
          style={{
            width: `${circleSize}px`,
            height: `${circleSize}px`,
            borderRadius: '50%',
            backgroundColor: 'darkgreen', // Adjust the color as needed
            position: 'absolute',
            left: `${2 * bottomCircleSpacing}px`,
            top: `${bottomCircleY}px`,
          }}
        ></div>
        <div
          className="circle"
          style={{
            width: `${circleSize}px`,
            height: `${circleSize}px`,
            borderRadius: '50%',
            backgroundColor: 'darkgreen', // Adjust the color as needed
            position: 'absolute',
            left: `10px`,
            top: `${topCircleY}px`,
          }}
        ></div>
        <div
          className="circle"
          style={{
            width: `${circleSize}px`,
            height: `${circleSize}px`,
            borderRadius: '50%',
            backgroundColor: 'darkgreen', // Adjust the color as needed
            position: 'absolute',
            left: `${5 + topCircleSpacing}px`,
            top: `${topCircleY}px`,
          }}
        ></div>
      </div>
    );
  };

  return (
    <div className="bush-container">
      {bushes.map((bush, index) => (
        <div
          key={index}
          className={`bush ${moleIndex === index ? 'with-mole' : ''}`}
          style={{
            position: 'absolute',
            left: `${bush.x}px`,
            top: `${bush.y}px`,
            zIndex: 1,
          }}
          onClick={() => (moleVisible ? handleMoleClick(index) : handleBushClick(index))}
        >
          {renderCircles()}
          {moleVisible && moleIndex === index && (
            <div
              className="mole"
              style={{
                backgroundColor: 'brown',
                width: '30px',
                height: '30px',
                borderRadius: '50%',
                position: 'absolute',
                top: `${molePosition.y - bush.y + 10}px`,
                left: `${molePosition.x - bush.x + 30}px`,
              }}
            ></div>
          )}
        </div>
      ))}
    </div>
  );
};

export default Bush;
